import { createIcon } from "../icon/createIcon";

export const ScheduleTimeIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="ScheduleTimeIcon">
    <path d="M8 4h2V2h1v3H7V1H2v10h9v1H1V0h8v1H8v3zm2-3v1H9V1h1z" />
    <path d="M10 5h1v6h-1V5zM5.5 5a2.5 2.5 0 1 1 0 5 2.5 2.5 0 0 1 0-5zm.412.852h-.618v1.442h-.618v.618h1.236v-2.06z" />
  </svg>,
  "ScheduleTime",
  "schedule time"
);
